void casadi_f11_free_mem(int mem) {
  osqp_cleanup(casadi_f11_mem[mem]);
}

int casadi_f11_checkout(void) {
  int mid;
  if (casadi_f11_unused_stack_counter>=0) {
    return casadi_f11_unused_stack[casadi_f11_unused_stack_counter--];
  } else {
    if (casadi_f11_mem_counter==CASADI_MAX_NUM_THREADS) return -1;
    mid = casadi_f11_alloc_mem();
    if (mid<0) return -1;
    if(casadi_f11_init_mem(mid)) return -1;
    return mid;
  }
  return casadi_f11_unused_stack[casadi_f11_unused_stack_counter--];
}

void casadi_f11_release(int mem) {
  casadi_f11_unused_stack[++casadi_f11_unused_stack_counter] = mem;
}

